import React, {Component} from 'react';
import Sign from './Sign';

class Menu extends Component {
	render() {
		return (
			<div className="menu2">
				{Object.keys(this.props.signs).map(key => {
					<Sign
						key={key}
						index={key}
						sign={this.props.signs[key]}
						addToOrder={this.props.addToOrder}
					/>
				})}
			</div>
		)
	}
}
